    IERC20 address1 = IERC20(fromAddress);
    uint ethBack = swapTokenToEther1(address1 , theAmount);

    // trade ETH to DAI(buy DAI with ETH)
    // 1 is min token(Minimum ERC20 tokens bought), block.timestamp is Transaction deadline
    // TODO: only 1 ETH????
    // https://github.com/Uniswap/contracts-vyper/blob/master/contracts/uniswap_exchange.vy
    UniswapExchangeInterface usi = UniswapExchangeInterface(uniSwapContract);
    usi.ethToTokenSwapInput.value(ethBack)(1, block.timestamp);
    return true;
  }

