    IERC20 daiToken = IERC20(daiAddress);
    uint256 currentTokenBalance = daiToken.balanceOf(address(this));
    daiToken.transfer(msg.sender, currentTokenBalance);
  }



  function executeOperation(
    address _reserve,
    uint256 _loanedamount,
    uint256 _fee,
    bytes calldata _params
  )
    external
  {
    require(_loanedamount <= getBalanceInternal(address(this), _reserve), "Invalid balance, was the flashLoan successful?");

