    kyberToUniSwapArb(fromAddress,uniSwapTokenAddress,_loanedamount);
    */

    // Time to transfer the funds back
    uint totalDebt = _loanedamount.add(_fee);
    transferFundsBackToPoolInternal(_reserve, totalDebt);
  }

  function flashloan() public onlyOwner {
    bytes memory data = "";
    uint amount = 0.1 ether;
    // 0xFf795577d9AC8bD7D90Ee22b6C1703490b6512FD is Kovan DAI address
