    address asset = address(0xFf795577d9AC8bD7D90Ee22b6C1703490b6512FD);

    ILendingPool lendingPool = ILendingPool(addressesProvider.getLendingPool());
    lendingPool.flashLoan(address(this), asset, amount, data);
  }

}

